// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SysAdminRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SysAdmin) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSysAdminByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSysAdminUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSysAdminByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminByUsernamePrefix, item.Username)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminUnscopedByUsernamePrefix, item.Username)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminByDeptIDPrefix, item.DeptID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminUnscopedByDeptIDPrefix, item.DeptID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminByPostIDPrefix, item.PostID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminUnscopedByPostIDPrefix, item.PostID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminByRoleIDPrefix, item.RoleID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysAdminUnscopedByRoleIDPrefix, item.RoleID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
